      about:
        "Mama Glow is an abundant, radiant energy that comes from within. It’s your initiation, birthing yourself as a powerful woman, as you prepare to give birth to your bundle of joy. Birth is our rite of passage, a ceremony marking a transformative stage in your life, and Mama Glow is our birthright—to walk in immense grace, power, and wisdom, to have understanding, reverence, and the deepest trust in our bodies. Having faith in the benevolent universe and being an active participant in the co-creation of your beautiful life. This act of standing in your power ignites a force within that glows from the inside out. This is a call to all women to reclaim their bodies and the birth process as sacred. It’s a personal style that reflects confidence, beauty, radiance, and balance.<p style='color: white'>Overview<p style='color: white'>Mama Glow is New York’s premiere maternity lifestyle brand committed to supporting women along the childbearing continuum. We support women and families during the fertility period, during pregnancy, after birth and into new motherhood offering a full spectrum approach to holistic wellness. We are the first company to offer doula support at every stage along the childbearing continuum - including our premium fertility doula service for hopeful expectants. Mama Glow also offers a globally recognized doula immersion program educating doula-trainees from around the world to become the next generation of leaders that will help transform our modern health care system for women and babies. Having cultivated partnerships with some of the nation’s leading health organizations, Mama Glow is deeply committed to education, advocacy and impact. Our innovative programing takes space at our new women’s center in Brooklyn, Circle By Mama Glow, supporting women from menarche through menopause.<p style='color: white'>We at Mama Glow seek to support women at the most powerful and most vulnerable time in their lives- at the threshold of new motherhood. We hold the hands of our clients along every phase of their journey, before, during and after pregnancy, providing full spectrum service based offerings, education inspiration and advocacy. We do this in a holistic fashion, addressing the physical, emotional and spiritual needs of the women who make up our community. We belive in the power and wisdom of the female body. We offer an inclusive and safe space we and welcomes and support all types of family configurations.<p style='color: white'>About the Founder: After giving birth to her son Fulano in 2003, Latham Thomas set out on a mission to help women reclaim birth. A graduate of Columbia University & The Institute for Integrative Nutrition, Latham is a maternity lifestyle maven, world renown wellness leader and master birth doula on the vanguard of transforming the wellness movement. Named one of Oprah Winfrey&apos;s Super Soul 100, Latham is bridging the gap between optimal wellness, spiritual growth, and radical self care and is the go-to-guru for modern holistic lifestyle for women. She authored the bestselling book titled, “Mama Glow: A Hip Guide to a Fabulous and Abundant Pregnancy”, foreword by Dr. Christiane Northrup in 2012 and most recently published bestseller OWN YOUR GLOW: A Soulful Guide to Luminous Living and Crowning the Queen Within. Latham serves on the TUFTS University Nutrition Council and is also a member of the Well + Good Council where she provides expertise in women&apos;s wellness, pregnancy and self-care. In March of 2018, Latham released the meditation audio program, BEDITATIONS: Guided Meditations and Rituals for Rest and Renewal. She teaches at universities and teaching hospitals around the country, helping to improve the pateint labor and delivery experience.<p style='color: white'>",
